ONEcolor={}
function looking()
	screenTime = screenTime or os.time()
	
	local oldcolorWZ = {
		{126,  290, 0x1aa5f7},
		{449,  286, 0x1e1e1f},
		{471,  731, 0xbba7a3},
		{170,  724, 0xb9b7b9},
		{405, 1036, 0xffffff},
	}
	
	frist = frist or 0
	if frist == 0 then
		screen.keep()
		for i,v in ipairs(oldcolorWZ)do
			ONEcolor[i]=screen.get_color(v[1],v[2])
		end
		screen.unkeep()
		frist = 1
	end
	
	--log(ONEcolor)
	
	sameColor = 0
	screen.keep()
	for i,v in ipairs(oldcolorWZ)do
		local colordian = screen.get_color(v[1],v[2])
		if colordian == ONEcolor[i] then
			log("颜色相同")
			sameColor = sameColor + 1
		else
			log("颜色不同")
			ONEcolor[i] = colordian
		end
	end
	screen.unkeep()
	
	if sameColor >= 5 then
		log("卡屏了")
		if os.time() - screenTime > 25 then
			closeX(app.front_bid())
			screenTime = os.time()
		end
	else
		log("屏幕有变化")
		screenTime = os.time()
	end
	
	sys.msleep(1000)
end



